INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc8713e5e001d', '健康管理中心', '管理员', '402881fc5b93d356015b93d48c0a0006', '2017-05-02 17:19:37', '琦媛国际健康管理机构私人定制健康服务平台，提供最顶尖、独特、专利医学技术给您体验全方位最贴心的服务。量身定制顶级抗衰老方案及先进的预防医学与医学美容服务；让身、心、灵得到全方位健康疗效，给您青春美丽的健康蓝图。\r\n', null, '/files/file/qiyInformation/2017-05-02/20141206152702_91983.jpg-a04133bce16840ed83717e1faf7fb79c.jpg', '<div style=\"text-align:center;\">\r\n	<img src=\"/files/file/uploadKind/2017-05-02/u3228.jpg-b07f5fe0a437471087bf38ff68836440.jpg\" title=\"u3228.jpg-b07f5fe0a437471087bf38ff68836440.jpg\" alt=\"u3228.jpg-b07f5fe0a437471087bf38ff68836440.jpg\" />\r\n</div>', '0', '1', null, '0', '2017-05-02 17:15:16', 'superAdmin.超级管理员', '2017-05-02 17:19:37', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cb503001a');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc87239b60021', '健康检测中心', '管理员', '402881fc5b93d356015b93d48c0a0006', '2017-05-02 17:19:38', '每一个细胞都是一名歌唱者，人体每根骨头、器官各自以特定音律发出和谐的音乐；罗某器官的“嗓子”出问题，以致音律有所偏差，整个身体将受影响而导致生病。5D-MRA无疑是最好的身体探音器，“聆听”身体每个细胞，发现身体潜在的病“音”。', null, '/files/file/qiyInformation/2017-05-02/4.jpg-825722ad6ae14625b425d1146a0ea080.jpg', '<div style=\"text-align:center;\">\r\n	<img src=\"/files/file/uploadKind/2017-05-02/u3228.jpg-c994db84c2ba4d1c906b0c7556df95c2.jpg\" title=\"u3228.jpg-c994db84c2ba4d1c906b0c7556df95c2.jpg\" alt=\"u3228.jpg-c994db84c2ba4d1c906b0c7556df95c2.jpg\" />\r\n</div>', '0', '1', null, '0', '2017-05-02 17:16:20', 'superAdmin.超级管理员', '2017-05-02 17:19:38', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cb503001a');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc8735fec0025', '健康管理重要性', '管理员', '402881fc5b93d356015b93d48c0a0006', '2017-05-02 17:20:31', '健康是人类最宝贵的财富。有了健康与活力，人生便有无限的可能。琦媛国际医疗健康管理机构本持“没有伤害”与“恢复自体自愈能力”为宗旨，提供具科学证实的整合医学疗法。使用最自然无害的辅助性疗法，以及尖端生物技术的健康评估检测，为您量身定做个人化医疗计划，做好健康资产管理，不仅治疗您的疾病，更让您充满年轻活力。', null, '/files/file/qiyInformation/2017-05-02/20141215103948_40338.jpg-a3f11af407cd47e680395c4e52992884.jpg', '<div style=\"text-align:center;\">\r\n	<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-ec65fc5f387e4ffca2a8d331af32c95d.jpg\" title=\"1.jpg-ec65fc5f387e4ffca2a8d331af32c95d.jpg\" alt=\"1.jpg-ec65fc5f387e4ffca2a8d331af32c95d.jpg\" />\r\n</div>', '0', '1', null, '0', '2017-05-02 17:17:36', 'superAdmin.超级管理员', '2017-05-02 17:20:31', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cb503001a');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc87400e30029', '健康抗衰中心', '管理员', '402881fc5b93d356015b93d48c0a0006', '2017-05-02 17:20:32', '美国生命医学研究院跨世纪研究成果，人类抗衰防癌里程碑；通过淋巴细胞包裹能够定点、靶向作用于各器官和组织细胞，穿透细胞，修复丢失受损的DNA片段，30分钟使新生细胞重组生效，刺激健康细胞生长，加速新陈代谢，最终达到康复保健、调理亚健康、防癌抗衰老的功效。\r\n', null, '/files/file/qiyInformation/2017-05-02/20141206152754_66776.jpg-d36f7b64eaa4435ba967dc29e52a48c1.jpg', '<div style=\"text-align:center;\">\r\n	<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-3f7f29266138494baef51f2c18a4010a.jpg\" title=\"1.jpg-3f7f29266138494baef51f2c18a4010a.jpg\" alt=\"1.jpg-3f7f29266138494baef51f2c18a4010a.jpg\" />\r\n</div>', '0', '1', null, '0', '2017-05-02 17:18:17', 'superAdmin.超级管理员', '2017-05-02 17:20:32', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cb503001a');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc875250e002d', '健康保健中心', '管理员', '402881fc5b93d356015b93d48c0a0006', '2017-05-02 17:20:33', '一种生命能量补充点滴，利用静脉注射的方式，在短时间内将大量人体必需的能量，如双胜胺、维他命、氨基酸、电解质及其他有益的成分导入身体中，让身体迅速补充各个器官所需细胞能量。', null, '/files/file/qiyInformation/2017-05-02/20150428150303_30193.jpg-0960092adcbc402a904fa76127a20c92.jpg', '<div style=\"text-align:center;\">\r\n	<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-60cc6572fa584c529ca319111100b807.jpg\" title=\"1.jpg-60cc6572fa584c529ca319111100b807.jpg\" alt=\"1.jpg-60cc6572fa584c529ca319111100b807.jpg\" />\r\n</div>', '0', '1', null, '0', '2017-05-02 17:19:32', 'superAdmin.超级管理员', '2017-05-02 17:20:33', 'superAdmin.超级管理员', '1', '1', '402881fc5b9dd54a015b9dd67d490008,402881fc5b9e91cb015b9e9cb503001a');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc8770b7e0046', '面部定制管理中心', '管理员', '402881fc5b9e91cb015b9e97e9480004', '2017-05-02 17:24:54', '以“无创、不开刀”为原则，安全、自然、快速的运用非手术或非介入性医学手段，量身定制方案，将塑美时间缩短至10分钟。不仅让您更快地拥有美丽， 更让您提升整体气质保持10年以上。', null, '/files/file/qiyInformation/2017-05-02/9k=.jpg-e7b4f240139b45a9b872fd0c740929d2.jpg', '<div style=\"text-align:center;\">\r\n	<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-b4fb9868bbbe48168cfba11e90a7e265.jpg\" title=\"1.jpg-b4fb9868bbbe48168cfba11e90a7e265.jpg\" alt=\"1.jpg-b4fb9868bbbe48168cfba11e90a7e265.jpg\" />\r\n</div>', '0', '1', null, '0', '2017-05-02 17:21:36', 'superAdmin.超级管理员', '2017-05-02 17:24:54', 'superAdmin.超级管理员', '1', '1', '402881fc5b9dd54a015b9dd67d490008,402881fc5b9e91cb015b9e9cdf48001d');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc8779d9e004a', '眼部定制管理中心', '管理员', '402881fc5b9e91cb015b9e97e9480004', '2017-05-02 17:24:55', '无痕、无痛定位微点美眼技术结合全球最先进的眼部三维立体系统，真正做到微创无痕、恢复快，塑造完美无痕靓丽的“水汪汪”眼神。', null, '/files/file/qiyInformation/2017-05-02/20141206152832_21529.jpg-b7b28efbc4ad495b9a7d5e654f3425ce.jpg', '<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-3a357a8f714c46db9450a8b47088040b.jpg\" title=\"1.jpg-3a357a8f714c46db9450a8b47088040b.jpg\" alt=\"1.jpg-3a357a8f714c46db9450a8b47088040b.jpg\" />', '0', '1', null, '0', '2017-05-02 17:22:14', 'superAdmin.超级管理员', '2017-05-02 17:24:55', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cdf48001d,402881fc5b9dd54a015b9dd67d490008');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc8781d09004e', '胸部定制管理中心', '管理员', '402881fc5b9e91cb015b9e97e9480004', '2017-05-02 17:24:56', '唯美的胸型，应该符合Natural（自然）、Aesthetic（唯美）、Plump（丰满）3大标准，来自韩国尖端的自体干细胞提取技术与个性化的假体定制，通过独到的美学理念与整形技术，完全依托每个人身材特点和基础量身定制，真正的从个人角度、美学角度、技术角度全面打造唯美胸型。', null, '/files/file/qiyInformation/2017-05-02/20141215104021_14567.jpg-4fa7793a9b5b448091b8ba597e38c91c.jpg', '<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-548be0b8abc44a1abdcdacfc48c443b3.jpg\" title=\"1.jpg-548be0b8abc44a1abdcdacfc48c443b3.jpg\" alt=\"1.jpg-548be0b8abc44a1abdcdacfc48c443b3.jpg\" />', '0', '1', null, '0', '2017-05-02 17:22:46', 'superAdmin.超级管理员', '2017-05-02 17:24:56', 'superAdmin.超级管理员', '1', '1', '402881fc5b9dd54a015b9dd67d490008,402881fc5b9e91cb015b9e9cdf48001d');
