INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc87ae36d006a', '形象气质管理系统', '管理员', '402881f15bc7e120015bc87a4a050065', '2017-05-02 17:29:55', '全球顶级的艺术大师为满足每一位贵宾需求而“量身订制”，打造专属于自己的“美丽订制”。以高级私人定制、个性化时尚定制系统，结合医学、美学、气质学等，健康为基础、赋以个性化的美丽气质，让东方女性更健康、更美丽。', null, '/files/file/qiyInformation/2017-05-02/1.png-8001fd954742426c9ec82d8a0d0b6dd1.png', '<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-79126240e2f648d1a6407136f24c8fb7.jpg\" title=\"1.jpg-79126240e2f648d1a6407136f24c8fb7.jpg\" alt=\"1.jpg-79126240e2f648d1a6407136f24c8fb7.jpg\" />', '0', '1', null, '0', '2017-05-02 17:25:48', 'superAdmin.超级管理员', '2017-05-02 17:29:55', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cdf48001d,402881fc5b9dd54a015b9dd67d490008');
INSERT INTO `qiy_information` VALUES ('402881f15bc7e120015bc87b5cc0006e', '面部标准管理系统', '管理员', '402881f15bc7e120015bc87a4a050065', '2017-05-02 17:29:56', '古代美女讲究“三庭五眼”，进入现代审美有了新变化，如眼睛更大更长一点，嘴巴更丰满性感一点，之后又有了“四高三低”。所以经过演变，这两个新标准就成为中国乃至亚洲人的面部审美标准。 ', null, '/files/file/qiyInformation/2017-05-02/20141208111111_67175.jpg-4eadc26a9e524dadaa11a7952e31466d.jpg', '<img src=\"/files/file/uploadKind/2017-05-02/1.jpg-edac236460874beb95f7f02344cb513c.jpg\" title=\"1.jpg-edac236460874beb95f7f02344cb513c.jpg\" alt=\"1.jpg-edac236460874beb95f7f02344cb513c.jpg\" />', '0', '1', null, '0', '2017-05-02 17:26:19', 'superAdmin.超级管理员', '2017-05-02 17:29:56', 'superAdmin.超级管理员', '1', '1', '402881fc5b9e91cb015b9e9cdf48001d,402881fc5b9dd54a015b9dd67d490008');
