INSERT INTO `qiy_specialist` VALUES ('402881fc5b93d356015b93dc7e660023', '402881fc5b93d356015b93d6c9ac001b', '陈医师', '/files/file/qiySpecialist/2017-05-02/20141215104655_39969.jpg-8f6ac659f4c54fd19caf7abb4e178aa4.jpg', '新县城新城医院', '440300,440304', '车公庙', '擅长健康理疗，腰部瘦身', '<span style=\"color:#333333;font-family:微软雅黑, \"font-size:14px;background-color:#FFFFFF;\">首先，要具有很强的业务能力，毕竟医生是专业性很强的职业，如果业务能力不强而成为真正的好医生，是不现实的；第二，很强的沟通能力，尤其与患者的沟通能力、亲和力，是很重要的；第三，旺盛的精力，医生需要不断学习，不断充电，临床、科研、教学，一样都不能少，如果精力不济，想做到这些不容易；第四，很强的自我调节能力，临床工作中会遇到各方面的压力，如果不学会自我调节，想持续进步发展，是不现实的；第五，真正的爱心，要宅心仁厚，把医生当事业来做而不是专业来做，用心来做，而不是为了糊口而做；第六，要有广泛的人脉，特别在所在医院，所在专业，要有较高的知名度和认可度，在患者中也要有很好的口碑。</span>', '402881fc5b93d356015b93d69d170014', '1', null, '0', '2017-03-01 15:56:54', 'superAdmin.超级管理员', '2017-05-02 17:40:37', 'superAdmin.超级管理员', '8', '402881fc5b9f5f61015b9f64ab230032');
